import React,{useState} from 'react';

const Comp = (props) =>{
    const [line,setline] =useState(false);
    const cut = () =>{
        setline(true);
    };
    return(
        <>
        <div>
            <li><CancelIcon onClick={cut}/><span style={{textDecoration: line ? 'line-through':'none'}}>{props.val}</span></li>
        </div>
        </>
    );
};
export default Comp;
